// export default AIPanel

import React, { useState } from "react";

// Main AI Panel Component
const AIPanel = ({ data }) => {
  return (
    <div className="altitude-panel py-6 px-10 max-w-3xl w-full mx-auto space-y-4 bg-white rounded-xl shadow-lg">
      <h1 className="text-2xl font-bold mb-4">AI Predictions Panel</h1>
      {data.predictions.map((prediction, index) => (
        <PredictionPanel key={index} prediction={prediction} index={index} />
      ))}
    </div>
  );
};

// Prediction Panel with Collapsible Dropdown
const PredictionPanel = ({ prediction, index }) => {
  const [isOpen, setIsOpen] = useState(false);

  return (
    <div className="prediction-panel bg-gray-100 p-4 rounded-lg shadow-md">
      {/* Dropdown Header */}
      <div
        className="flex justify-between items-center cursor-pointer"
        onClick={() => setIsOpen(!isOpen)}
      >
        <h3 className="text-lg font-bold">
          Prediction {index + 1} - Class: {prediction.class}
        </h3>
        <button className="text-gray-500">{isOpen ? "▲" : "▼"}</button>
      </div>

      {/* Dropdown Content */}
      {isOpen && (
        <div className="mt-4 space-y-2">
          <p>
            <strong>X:</strong> {prediction.x}
          </p>
          <p>
            <strong>Y:</strong> {prediction.y}
          </p>
          <p>
            <strong>Confidence:</strong> {Math.round(prediction.confidence * 100)}%
          </p>
          <p>
            <strong>Class:</strong> {prediction.class}
          </p>
        </div>
      )}
    </div>
  );
};

export default AIPanel;
